const ImageGridListStyle = {
	root: {
	    display: 'flex',
	    flexWrap: 'wrap',
	    justifyContent: 'space-around',
	    overflow: 'hidden',
	},
	gridList: {
		width: "100%",
		height: "auto"
	},
	gridImg: {
		'&;before': {
			content: '',
			padding: "20px"
		}
	}
};

export default ImageGridListStyle;
